/**
 * Relation Component
 * -------------------------------------
 * Draws a UML-style line from source class to target class.
 */

import React from "react";
import PropTypes from "prop-types";

const Relation = ({
  source,
  target,
  type,
  cardinality,
  classWidth = 200,
  classHeight = 100,
}) => {
  if (!source || !target) return null;

  // Calculate connection points on the edges of class boxes
  const calculateConnectionPoints = () => {
    const centerX1 = source.x + classWidth / 2;
    const centerY1 = source.y + classHeight / 2;
    const centerX2 = target.x + classWidth / 2;
    const centerY2 = target.y + classHeight / 2;

    // Calculate angle between centers
    const angle = Math.atan2(centerY2 - centerY1, centerX2 - centerX1);

    // Calculate intersection points with class box edges
    let startX, startY, endX, endY;

    // Source point
    if (Math.abs(Math.cos(angle)) > Math.abs(Math.sin(angle))) {
      // Intersect with left/right edges
      startX = centerX1 + (Math.cos(angle) > 0 ? classWidth / 2 : -classWidth / 2);
      startY = centerY1 + Math.tan(angle) * (startX - centerX1);
    } else {
      // Intersect with top/bottom edges
      startY = centerY1 + (Math.sin(angle) > 0 ? classHeight / 2 : -classHeight / 2);
      startX = centerX1 + (startY - centerY1) / Math.tan(angle);
    }

    // Target point
    if (Math.abs(Math.cos(angle)) > Math.abs(Math.sin(angle))) {
      endX = centerX2 + (Math.cos(angle) > 0 ? -classWidth / 2 : classWidth / 2);
      endY = centerY2 + Math.tan(angle) * (endX - centerX2);
    } else {
      endY = centerY2 + (Math.sin(angle) > 0 ? -classHeight / 2 : classHeight / 2);
      endX = centerX2 + (endY - centerY2) / Math.tan(angle);
    }

    return { startX, startY, endX, endY };
  };

  const { startX, startY, endX, endY } = calculateConnectionPoints();

  // Calculate midpoint for cardinality text
  const midX = (startX + endX) / 2;
  const midY = (startY + endY) / 2;

  // Calculate marker size based on line length
  const lineLength = Math.sqrt(Math.pow(endX - startX, 2) + Math.pow(endY - startY, 2));
  const markerSize = Math.min(Math.max(lineLength * 0.1, 10), 20); // Between 10 and 20 pixels

  return (
    <svg
      style={{
        position: "absolute",
        pointerEvents: "none",
        top: 0,
        left: 0,
        width: "100%",
        height: "100%",
      }}
    >
      <defs>
        {/* Triangle marker for generalization */}
        <marker
          id="umlTriangle"
          viewBox="0 0 10 10"
          refX="10"
          refY="5"
          markerWidth={markerSize}
          markerHeight={markerSize}
          orient="auto"
        >
          <path d="M 0 0 L 10 5 L 0 10 z" fill="white" stroke="black" />
        </marker>

        {/* Diamond marker for aggregation */}
        <marker
          id="umlDiamondHollow"
          viewBox="0 0 12 12"
          refX="0"
          refY="6"
          markerWidth={markerSize}
          markerHeight={markerSize}
          orient="auto"
        >
          <path d="M 0 6 L 6 0 L 12 6 L 6 12 Z" fill="white" stroke="black" />
        </marker>

        {/* Filled diamond marker for composition */}
        <marker
          id="umlDiamondFilled"
          viewBox="0 0 12 12"
          refX="0"
          refY="6"
          markerWidth={markerSize}
          markerHeight={markerSize}
          orient="auto"
        >
          <path d="M 0 6 L 6 0 L 12 6 L 6 12 Z" fill="black" stroke="black" />
        </marker>

        {/* Arrow marker for dependency */}
        <marker
          id="umlArrow"
          viewBox="0 0 10 10"
          refX="10"
          refY="5"
          markerWidth={markerSize}
          markerHeight={markerSize}
          orient="auto"
        >
          <path d="M 0 0 L 10 5 L 0 10" fill="none" stroke="black" />
        </marker>
      </defs>

      {/* Main line */}
      <line
        x1={startX}
        y1={startY}
        x2={endX}
        y2={endY}
        stroke="black"
        strokeWidth="2"
        markerStart={
          type === "aggregation"
            ? "url(#umlDiamondHollow)"
            : type === "composition"
            ? "url(#umlDiamondFilled)"
            : null
        }
        markerEnd={
          type === "generalization"
            ? "url(#umlTriangle)"
            : type === "dependency"
            ? "url(#umlArrow)"
            : null
        }
        strokeDasharray={type === "dependency" ? "5,5" : "none"}
      />

      {/* Cardinality text */}
      {cardinality && (
        <text
          x={midX}
          y={midY - 10}
          textAnchor="middle"
          fill="black"
          fontSize="12"
          fontFamily="Arial"
          backgroundColor="white"
        >
          {cardinality}
        </text>
      )}
    </svg>
  );
};

Relation.propTypes = {
  source: PropTypes.shape({
    x: PropTypes.number,
    y: PropTypes.number,
  }).isRequired,
  target: PropTypes.shape({
    x: PropTypes.number,
    y: PropTypes.number,
  }).isRequired,
  type: PropTypes.oneOf([
    "association",
    "aggregation",
    "composition",
    "generalization",
    "dependency",
  ]).isRequired,
  cardinality: PropTypes.string,
  classWidth: PropTypes.number,
  classHeight: PropTypes.number,
};

export default Relation;
